package com.dw.leetcode;
import java.util.*;
// https://leetcode.com/problems/number-of-substrings-with-only-1s/
public class NumberofSubstringsWithOnly1_1513 {
	public int numSub(String s) {
		boolean insideOne = false;
		List<Integer> oneList = new ArrayList<Integer>();
		int counter = 0;
		for(int i=0;i<s.length();i++) {
			if(s.charAt(i) == '1' && !insideOne) {
				insideOne = true;
				counter = 1;
			}
			
			else if(s.charAt(i) == '1' && insideOne) {
				counter++;
			}
			
			else if(s.charAt(i) == '0' && insideOne) {
				insideOne = false;
				oneList.add(counter);
				counter = 0;
			}
		}
		
		if(insideOne && counter >=1) {
			oneList.add(counter);
		}
		for(int n: oneList) {
			System.out.println(n);
		}
		long result = 0;
		for(int n: oneList) {
			result += (long)n*(long)(n+1)/2;
			result %= 1000000007;
		}
		return (int)result;
    }
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		NumberofSubstringsWithOnly1_1513 s = new NumberofSubstringsWithOnly1_1513();
		String str = "";
		System.out.println(s.numSub(str));
	}

}
